int b64decode(char c) {
    if (isupper(c)) return c - 'A';
    if (islower(c)) return c - 'a' + 26;
    if (isdigit(c)) return c - '0' + 52;
    if (c == '+') return 62;
    if (c == '/') return 63;
    return -1;
}

int main(void) {
    int t, n;
    scanf("%d", &t);
    for (int i = 0; i < t; i++) {
        scanf("%d", &n);
        if (n & 1) {
            if ((b64decode(hard[(n / 12) >> 10][(n / 12) & 1023]) >> ((n % 12) >> 1)) & 1) printf("unlucky\n");
            else printf("lucky\n");
        }
        else printf("unlucky\n");
    }
    return 0;
}